//generic function for activating a drop-down menu
function activateMenu(menuNo){
	layerObj = document.getElementById("menu"+menuNo);

	layerObj.style.setProperty('display','block','important');
}

//generic function for de-activating a drop-down menu
function deactivateMenu(menuNo){
	layerObj = document.getElementById("menu"+menuNo);

	layerObj.style.setProperty('display','none','important');
}

//active drop-down menu option
var menuOptionActiv = new Array();
menuOptionActiv[1] = -1;
menuOptionActiv[3] = -1;
menuOptionActiv[4] = -1;

//function for change the bgcolor of the active option from the drop-down menu
function hooverOption(menuNo, optNo){
	if(menuOptionActiv[menuNo] > 0){
		layerObj = document.getElementById("Menu"+menuNo+"Opt"+menuOptionActiv[menuNo]);
		if(layerObj == "[object SVGRectElement]"){

			layerObj.style.setProperty("fill","#ffffff","important");
		}
	}

	layerObj = document.getElementById("Menu"+menuNo+"Opt"+optNo);
	if(layerObj == "[object SVGRectElement]"){

		layerObj.style.setProperty("fill","#f0f0f0","important");

		menuOptionActiv[menuNo] = optNo;
	}
}

//selected drop-down menu option
var menuOptionSel = new Array();
menuOptionSel[1] = 1;
menuOptionSel[3] = 1;
menuOptionSel[4] = 1;

//function for changing option from the drop-down menu
function setOption(menuNo, optNo){
	if((menuOptionSel[menuNo] < 0) || ((menuOptionSel[menuNo] > 0) && (menuOptionSel[menuNo] != optNo))){
		changeStatus = true;

		layerObj = document.getElementById("Menu"+menuNo+"OptSel"+menuOptionSel[menuNo]);
		if(layerObj == "[object SVGTextElement]"){

			layerObj.style.setProperty('display','none','important');
		}

		layerObj = document.getElementById("Menu"+menuNo+"OptSel"+optNo);
		if(layerObj == "[object SVGTextElement]"){

			layerObj.style.setProperty('display','block','important');

			if((menuOptionSel[menuNo] < 0) && (optNo == 1)){
				changeStatus = false;
			}

			menuOptionSel[menuNo] = optNo;
		}

		if(changeStatus){
			if(menuNo == 1){
				linksOnOff();
			}
		}
	}

	deactivateMenu(menuNo);
}

